之前刚推完了smee的新作，然后很想推经常在贴吧看到的sana，就推了一晚上的纯白交响曲，虽然在Bangumi就看到评论评价很高，心里预期就不低，但实际感受下来后，还是得感叹，这真的是恋爱gal的神作，让我那晚上的心情都轻松平静下来了，狠狠的吃了波糖，享受恋爱的甜蜜。<br><br>
我准备今晚继续推的，然后等下去健身房跑跑步，还是的跑跑，希望能对治肠炎有好处，今晚能舒服点吧。</p>
