因为，我没法无视性欲在我这一生里的影响，无论是初中时因为性发育问题导致的自卑，高中时性趣的发展，大学时见识到的各种性相关的知识和文化，都很大程度上影响了我个人性格和三观的成长，进而影响我的决定和对事情的判断，以至于，应该是我工作后，我才意识到，我没法戒色，戒不了色，我渴望色情，放弃抵制后才真正接受了自己是个好色之徒，该坦然的承认和接受自己对于性欲的追求，而不是掩盖和拒绝，当然还是会节制，所以到现在，我并不拒绝一些性行为，甚至做些尝试，列如避孕套，抱枕，飞机杯，不过也是最近才搞得，一般也都是看看本子，拔作，色情动画之类的。<br><br>
