我知道我写的不好，但我不想看一遍，然后进行删改修正，进行补充扩写，那样我会很痛苦，我个人追求当时情感的真实宣泄，虽然后面再精修之类的我也慢慢在尝试，但上面这些我是真的不想再看一遍，真的，这会让我痛苦。<br><br>
我也不用别人理解，因为别人根本没法理解，我只希望，你们能知道存在我这么一个另类的人就好了。<br><br>
所以最后，就让我这么结束这一篇吧：<br><br>
我是个好色之徒，我追求性欲带给我的快乐和抚慰，假使某天性欲消失，那么我也将不复存在。<br><br>
